import React, { useState } from "react";
import { NavbarContainer, NavLogo, Nav } from "./styling/Navbar.styled";

export const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo>Axios.io</NavLogo>
        </NavbarContainer>
      </Nav>
    </>
  );
};
